INSERT INTO `phpbb_posts_text` (`post_id`, `bbcode_uid`, `post_subject`, `post_text`) VALUES
(2, '915807dfa8', 'Welcome!', 'Hey everybody,\r\nThis is Benji, the ''webmaster'' of SeattleDIY.com.\r\n\r\nThis forum is for whatever will be useful for you kids, from questions about adding things to the calendar to seeing if anyone has an open room at a cool house. Or you can advertise your event that may not be appropriate for the official calendar. Enjoy!\r\n\r\n-Benji'),
(3, '703b978d8f', 'Droptooth Bike Collective, bicycle rides, etc.', 'The Droptooth Bike Collective in Georgetown (at the Fire Breathinking Kangaroo House, aka FBK) isn''t doing their regular drop-in hours, because the kids don''t have enough time to staff it regularly. Instead, if you''re intersted in using the workshop to fix up your bike or learn skills, call them at 206-763-1896.\r\n\r\nHowever, there is a new bicycle collective opening up in the rear of Wayward Cafe ([url]http://www.myspace.com/waywardcafe[/url]) that will be open and functional soon, so stay tuned. \r\n\r\nAnd additionally, the .83 Tuesday Bike Rides are still happening, but on a week-to-week basis. So check their website ([url]http://www.point83.com[/url]) on their message board for details. They usually meet up at 7pm at Red Square (on UW campus).\r\n\r\n-Benji'),
(4, 'd7a993387a', 'Posi Alex is looking for a place...', 'Alex is looking for a rad place. Anyone know anywhere with a room open? \r\n\r\nHere''s Alex''s myspace!\r\n[url]http://profile.myspace.com/index.cfm?fuseaction=user.viewprofile&amp;friendID=939243&amp;Mytoken=7EADFB94-10EB-EA5C-A3BE121531BC204685908749[/url]'),
(5, '0b8fe82a9c', 'New Years Eve!', 'Are any houses putting on anything for New Years Eve? \r\nSome friends are looking to play a show on that night - Margaret Thrasher from Vancouver BC. If anyone knows anywhere, let me know.\r\n\r\n-Benji'),
(6, 'bb29e2ab81', 're: looking for room', 'repost: Outhaus in U-District (seattle) looking for awesome housemate for December \r\nMessage: Hi. We are an awesome communal house looking \r\nfor an awesome housemate. \r\n\r\nWe love bikes, gardening, and dumpstering. We \r\nare in the process of turning our garage into an \r\nindoor rock-climbing gym and an art studio. \r\n\r\nOne of our housemates is leaving to move in with \r\nhis sweetie.\r\n\r\nThe room is beautiful with hard-wood floors and \r\nwest-facing windows. \r\n\r\nrent is $280 + Utilities/ phone\r\n\r\nplease email Oscar for more details or call us at:\r\n\r\n206-525-1047\r\n\r\nemail: oscarmolof@yahoo.com\r\n\r\nI can also be reached here via friendster\r\n\r\n\r\nThe space is open Dec, 1st.\r\n\r\n\r\nPlease Repost! thank you - Oscar'),
(7, '5e58e26a0e', 'UW Bike auction! 12/10/05', 'Hey friends,\r\nThe University Of Washington is having a bicycle auction (along with other things, too). So yeah, heads up - if you''re looking for a bike, you should probably go to that.\r\n\r\n-Benji'),
(8, 'f1406ad5a3', 'oops, I forgot the link', '[url]http://www.washington.edu/admin/surplus/dec2005catalog.html[/url][/url]'),
(9, 'ea57beb3b5', 'moving to seattle', 'how hard is it to move to seattle as a college age student, get a job, apt... how much can you expect to pay for apt?'),
(10, '8d76ae83ee', 'Re: moving to seattle', 'That all depends on where in Seattle you want to live. If you''re aiming for the wealthy gentrified gay neighborhood, expect to pay $550 for a studio appartment (and that''s cheap for Capitol Hill). In the University District, $450 is more reasonable for a studio apt. \r\nHowever, you can find 1 bedrooms or studios for less in other, less interesting and convenient neighborhoods.\r\nJobs are generally hard to come by, but definitely not impossible. If all else fails, you can get a job at an indian restaurant, which usually have high turn-over because most managers keep your tips. \r\nProbabably your best bet is to look on craigslist for both jobs and places to live, or keep an eye out on this message board for any houses looking for roommates (rooms at punk houses usually run from $200-300/month + util).\r\n\r\nHope that helps.\r\n-Benji'),
(11, 'e0eb5ed8c3', 'show help dec. 30th?', 'is there anyone who could help with a house / all ages show for two bands from portland on dec. 30th? we are life at these speeds and science of yabra. we''re nice, funny, respectful, everything you want and more....\r\n\r\ninfo/mp3s:\r\n\r\nlife at these speeds:\r\nkillingcupid.net/lats.html\r\nkillingcupid.net/say_yes.mp3\r\n\r\nscienceofyabra.com\r\n\r\n\r\nany help is greatly appreciated!!'),
(12, '938975166b', 'show time', 'hey alan, it''s coleen, casey''s friend. i''d love to help you out and am talking to some kids at the 414 right now. the catch is that i''m in california till the 29th so in the event that they do give me the house for the show i''ll have to work out fliering from afar. i''ll let you know if we can swing it. i''d love to see you kids play again.\r\n\r\n-c'),
(13, '94c67edb75', 'art activism', 'If anybody out there has any interest in starting some sort of activist/art project please let me know. Even if you just want to bash some ideas back and forth I am always up to hear from interesting people. I''m just at a point in life right now where I am sort of lost creatively and would appreciate [i:94c67edb75]any[/i:94c67edb75] suggestions.\r\n\r\n\r\nI do video, animation, drawing, stencils... whatever... I''m a multi-media kinda guy. [u:94c67edb75]Drop me a line.[/u:94c67edb75]'),
(14, '3ea46d6344', 'Volunteers are needed for lots of shit!', 'There are a lot of projects in Seattle that need volunteers. I suggest we have a running list of places that need people, and have contact info. Just reply to this topic with new ideas.\r\n\r\nSidecar For Pigs Peace is looking for volunteers. It''s a non-profit grocery store that''s 100% vegan, and all proceeds go to support the Pigs Peace farm sanctuary. Stop by Sidecar (on 55th + University Way in the U-District) any time tuesday through sunday and talk to Peggy.\r\n\r\nSeattleDIY.com is looking for people to help with this website. If you have skills with PHP or web design, let me know. I also need a lot of help with promotion, too.\r\n\r\nSeattle Food Not Bombs is always looking for volunteers. There''s three different FNB events happening during the week, and there''s a need for everything from drivers to cooks to servers. For details check out http://www.scn.org/activism/foodnotbombs/'),
(15, '9e8b3938cf', 'Re: show time', 'colleen! that''s awesome! thanks so much for offering to help. i might be able to get some help with flyering, too. let me know when you do (it''s getting pretty close): \r\n\r\nadubinsky at mac dot com\r\n\r\nhave in cali!'),
(16, '8bcce83bee', '', 'hey colleen-\r\nwe found a place for the show! thanks for your help; somebody else responded with a definite spot so we had to take it.\r\nhere''s the info in case you want to come:\r\n\r\nthe Neon Green House\r\n5401 Ravenna Ave NE / Seattle, WA 98105\r\nw/ good news, science of yabra, &amp; life at these speeds\r\n\r\nnot sure about the time yet... i imagine 7?\r\n\r\ntake care!\r\nalan'),
(17, 'fc0790ca35', 'Seattlediy.com has a myspace! Oh no!', 'Yeah, the website has a myspace. It''s an easy and convenient way to network (yeah, the same old excuse). \r\n\r\nIf you have one, befriend us!\r\n\r\n[url]http://www.myspace.com/sdiy[/url]\r\n\r\n-Benji'),
(18, '8481e350e8', '', 'The Bike workshop behind the Wayward Cafe needs extra hands, I think. Show up during their open hours and ask if they need anything. \r\nthurs, fri - 4-9\r\nsat, sun - 11-4'),
(19, 'd43125cb85', 'SeattleDIY print version?', 'Anyone want to make a paper version of the calendar? I think it might be a good idea. Let me know. Maybe we should also have a sdiy meeting, and see if anyone has fresh ideas for this website.\r\n\r\n-Benji'),
(20, '08132f0729', 'ZINE', 'were putting out a new issue of obscene gestures and were looking for demos/cds to review. If your band or any of your friends bands would like to be review for our zine you can send us a free copy(sorry strapped for cash) and we''ll review everything we recieve. Also if you have a zine of your own or a friend does we''d like to review that too. Thanks alot!\r\n\r\nm_25tolife@hotmail.com'),
(21, 'b40d46750c', 'Online Seattle dumpster diving map', 'Whoa, maybe this is a bad thing to publish such a thing online. But it''s still pretty cool. Here you go:\r\n\r\n\r\n[url]http://www.wayfaring.com/maps/export/3726[/url]'),
(22, 'faa48a7722', 'moving back to seattle', 'I''m moving back from Vancouver BC to Seattle at the end of this month and I am in need of a place to live. I''m wondering if anyone is interested in getting a place or have a place already that is vegan friendly. I am currently looking at places in the U.D., the C.D., and Capitol Hill. I''m vegan, a musician and love house shows and riding my bike. If anyone is interested please feel free to email me at killthewhitenoise@yahoo.com\r\n\r\nEli'),
(23, '06df6067db', 'outhouse', 'Eli, I think the Outhouse is looking for someone. Posi Alex lives there, along with some other cool kids. Do it!'),
(24, 'e20107582c', '', 'is your zine available outside seattle?'),
(25, '8414049cce', 'dumpsters', 'This should be expanded to tacoma, and I know of some sweet spots. Do you know about the odwalla dumpster?'),
(26, '187caa8f14', 'rooms open at the house in the woods feb. 1st, march 1st', 'the house in the woods is a small community located in the woods surrounding the u-district. we are in search of new members for rooms opening end of jan. and end of feb. for more information, take a look at: http://silverninja.net/room\r\nthis is a very special house in need of rad people who want to do lots of cool shit!'),
(27, 'bba5908768', 'Some opinions?', 'Hey everyone,\r\nWhat do people think about the limitations for what is allowed to be put on the calendar? Should we also allow events at the Vera Project (of which there are already a couple up)? And if not them, then the Paradox is also a non-profit, albeit a religious one, which makes me cringe a little. And what about events that might be of interest to this community that might be at a commercial venue? \r\nThoughts? \r\nOr maybe we should have a Seattlediy.com meeting at the Wayward cafe sometime, and talk about this stuff then. Hmm..\r\n\r\n-Benji'),
(28, '1f763170b3', 'Opinions', 'Hey man, actually I''d like to talk to you about your calendar. Specifically, getting the data from it and sharing the information out to other Web sites (with proper linkback and credits, of course).\r\n\r\nYou''ve got some good information, but it would do better if more people were informed of your events.\r\n\r\nI can help with that.\r\n\r\nGet at me:\r\n\r\nchadedge at osnap dot-net\r\n\r\nWord\r\n\r\nChad Edge'),
(29, 'fce3833479', 'Flophaus rooms available March 1st', 'The Flophaus in West Seattle will have two large rooms available around March 1st or possibly even Feb. 1st.  We are right under the West Seattle bridge, which is a 5-minute bus ride/15 minute bike ride to downtown.\r\n\r\nRent is $235/mo. plus approx. $40 in bills/mo. in the Winter(heat makes things more expensive).  \r\n\r\nWe are a 5 member music-friendly/veg-friendly household looking for RESPONSIBLE, NEAT(somewhat!), MATURE, similar-minded people.  We are not "sxe"(it''s great if you are, though), but if you have any alcohol/drug problems or just like to get drunk to have fun, PLEASE DO NOT CONTACT US!!!  We have had several problems with heavy drinkers and the idiotic, dangerous, irresponsible behavior that comes with them.  \r\n\r\nA security deposit of $250 is preferred as well, but we currently pay month-to-month so you wouldn''t need to sign a lease.  \r\n\r\nWe have two cats and other pets are welcome as long as they''re trained.\r\n\r\nPlease email Justin at flophaus@hotmail.com or call 206-666-7663\r\n\r\nThanks!'),
(30, '8eee004291', 'Re: rooms open at the house in the woods feb. 1st, march 1st', '[quote:8eee004291="caitlin"]the house in the woods is a small community located in the woods surrounding the u-district. we are in search of new members for rooms opening end of jan. and end of feb. for more information, take a look at: http://silverninja.net/room\r\nthis is a very special house in need of rad people who want to do lots of cool shit![/quote:8eee004291]\r\n\r\n\r\n\r\nDo you have an email address , im not from the states'),
(31, 'e5b6f9b2b4', 'drummer available', 'Hey dudes/dudettes,\r\n\r\nMy name''s Justin and I currently play in the band Tundra.  However, our viola player is moving in March to be with his girlfriend in North Carolina so we''re gonna call it quits after a couple more shows.  \r\n\r\nSo anyway, I''m looking for new people to play with.  I''ve been playing drums about 9 years, been on 5 DIY tours, booked 4 of them, set up over 100 shows for touring bands in Seattle...  I was also in the bands Gods Among Men and Our Secrets to Our Graves.  I''m not sure what style I wanna play cause I''m into a lotta different stuff, but i''d like to something creative and unique again, if possible.  If anyone plays cello, violin, viola, horns, whatever, that''s great...I''d like to work with more than just guitarists/bassists exclusively.  I''m into everything from extreme metal to classically influenced atmospheric stuff like GYBE, Hanged Up, Grails ect. to hardcore like Shotmaker/Red Scare to noise rock like Coughs, Lightning Bolt, Noxagt ect to post rock ala Tarental, Paul Newman, Slint...  \r\n\r\nDIY based with people with some politics would be my preference.  Let me know.  Thanks!  \r\n\r\n206-666-7663\r\n\r\nflophaus@hotmail.com'),
(32, '5d956a9b91', 'Small punk Venue', 'hey im looking to set up some shows for a freinds band in like febuary/early march.  whats a good punk venue thats small and reasonably easy to book? basements and warehouses are totally cool.  I''m not actually from seattle but I am thinking about moving there so yeah, help me out'),
(33, '933f9b5e96', 'We got a facelift. Thoughts?', 'Mr Giovanni helped me make the website a little nicer to look at and navigate. Any thoughts? Suggestions? I''m pretty lo-fi and novice with web stuff, so I''m always into helpful input.\r\n\r\n-Benji'),
(34, 'ca8e8506fe', 'stealin wheels IS NOT cool', 'keep your eyes out for my wheel! its a 650 with a bright yellow tire, although i am sure it was stolen for the hub (phil wood). it happened tonight (Thursday, Jan 19) outside the College Inn before 10pm! \r\n\r\nmy bike is not only the love of my life, but also the way i transport myself around town! \r\n\r\nbicyclesinskirts@gmail.com\r\n\r\nrock on.'),
(35, 'cf1ce52491', '', 'why, the ss marie antoinette, of corse. all-ways all-ages. contact malaki: formidabletriumverate@hotmail.com'),
(36, '7219ac6f29', 'THREE HOUSES looking for roommates!', 'There''s three houses that I know of that are looking for new roommates.\r\n\r\n--------------------------------------\r\n\r\n$330/month in the Central District near 14 &amp; 48 bus lines.\r\nThe house is into bikes, dumpster diving, gardening, musicians.\r\nCall Kendra at 360-402-4894\r\n\r\n--------------------------------------\r\n\r\nThe Flophaus in West Seattle will have two large rooms available around March 1st or possibly even Feb. 1st. We are right under the West Seattle bridge, which is a 5-minute bus ride/15 minute bike ride to downtown.\r\nRent is $235/mo. plus approx. $40 in bills/mo. in the Winter(heat makes things more expensive).\r\nWe are a 5 member music-friendly/veg-friendly household looking for RESPONSIBLE, NEAT(somewhat!), MATURE, similar-minded people. We are not "sxe"(it''s great if you are, though), but if you have any alcohol/drug problems or just like to get drunk to have fun, PLEASE DO NOT CONTACT US!!! We have had several problems with heavy drinkers and the idiotic, dangerous, irresponsible behavior that comes with them.\r\nA security deposit of $250 is preferred as well, but we currently pay month-to-month so you wouldn''t need to sign a lease.\r\nWe have two cats and other pets are welcome as long as they''re trained.\r\nPlease email Justin at flophaus@hotmail.com or call 206-666-7663\r\n\r\n----------------------------------------\r\n\r\nThe House In The Woods is a small community located in the woods surrounding the u-district. we are in search of new members for rooms opening end of jan. and end of feb. for more information, take a look at: http://silverninja.net/room\r\nthis is a very special house in need of rad people who want to do lots of cool shit!'),
(37, '2dddf31351', '', 'You should tell us about your friends band, and maybe give us a link so that we can hear their music and see what they''re all about. Most houses in the area don''t like to book bands unless it seems like they have something in common.'),
(38, '1ab59c300b', 'Sticker and flyer designers?', 'Hey you guys,\r\nI think that SeattleDIY needs more designs for flyers. I also want to start making some stickers. I seriously need some help with this, so if you have mad skillz or good ideas or anything, I would love the help or input.\r\n\r\nemail or mail me any designs you make at:\r\nheartxmurmur@yahoo.com\r\nor\r\n506 17th Ave E\r\nSeattle, WA 98112\r\n\r\nFlyers I''ll photocopy myself, or you can do it too - whatever works.\r\nStickers I''ll have printed at The Sticker Guy ([url]http://www.stickerguy.com[/url]). If you want to make stickers, check out the sizes page ([url]http://www.stickerguy.com/priclist.htm[/url])!\r\n\r\nLet''s Do It Together!\r\n\r\n-Benji[/url]'),
(39, '72b7c31d11', 'diy record label for seattle hard electonics', 'produce non rave hardcore electronic? we''re interested in checking you out. it''s hard to find a lot of resources for making alt electronic when first starting, but we''ve been around, and we''re here to help. PNW breakcore label break pop records is your friend.\r\n\r\n[url]http://breakpop.chuunk.com[/url]'),
(40, '8b1ee61c71', '', 'hey ben, if you want some help, i''m a pretty good designer. you knew jeff keenan right? do i have the right person? this is russell''s wife''s sister''s husband.\r\n\r\n[img:8b1ee61c71]http://music.chuunk.com/INSANE-BREAKS.jpg[/img:8b1ee61c71]\r\nredordie@chuunk.com\r\n\r\ni''ve been trying to singlehandedly start a breakcore scene up here, so i feel what you''re doing. keep up the good fight.'),
(41, '824b394d67', 'CARA is an awesome group. Here''s a repost.', 'If you support reproductive justice, radical anti-violence organizing, and\r\ndisability rights, please support CARA in our upcoming fundraisers.  We need our\r\ngrassroots supporters more than ever and would love to see you at these exciting\r\nevents!!!\r\n\r\n====================================================================\r\n\r\nCARA PRESENTS THE REVOLUTIONARY OSCARS PARTY!!\r\n\r\n* Are you a pop culture nerd with radical politics?\r\n* Do you criticize the waste of the wealthy, but still buy Us magazine to look\r\nat the dresses?\r\n* Have you been caught debating a feminist critique of the Brangelina affair?\r\n* Are you perplexed about why straight people winning awards for playing gay\r\npeople is supposed to be a sign that times are a changin?\r\n\r\nIf yes, you are among friends! Join CARA at the most political and most fabulous\r\nOscars party of the year!\r\n\r\nFUNDRAISER HOSTED BY YOUR FRIENDS AT CARA!\r\n\r\nWhen: Sunday, March 5, 2006, 4:00 pm to 8:00 pm (red carpet to best picture)\r\nWhere: The CARA Space transformed into an ideal Oscar Viewing Locale:\r\n801 23rd Ave. S., Suite G1 (Central District)\r\nSeattle, WA\r\n(Location is wheelchair accessible.)\r\n\r\nSuggested $25 donation — All proceeds go to CARA\r\n\r\nComplimentary gift bags! * Drinks &amp; hor’doeuvres * Opportunities to win amazing\r\nprizes! * Guerrilla analysis during commercial breaks of everything from outfits\r\nto win upsets and upsetting wins! * Revolutionary movie trivia! * Support\r\ncritical anti-violence organizing!\r\n\r\nFor more information, please contact Alisa at 206.276.9059 or\r\nfoxybrown@riseup.net\r\n\r\n=====================================================================\r\n\r\nCARA’s Going To The DOGS!!! \r\n\r\nPlease join CARA for a St. Paddy’s Day Parade for pooches and their owners! Rain\r\nor shine.\r\n\r\nWhen: Saturday, March 18\r\nTime: 2pm for registration/3pm parade starts\r\nWhere: Plymouth Pillars Park in Capital Hill in Seattle. Plymouth Pillars \r\nPark is located above I-5 between the intersections of Pine and Boren and \r\nPike and Minor. \r\n\r\nA $25 donation gets you a St. Patrick’s Day gift, photo and dog participation \r\ncertificate, costume contest entry, grand prize raffle ticket, and a goodie \r\nbag with pet gifts &amp; coupons for owners. Package discounts available for \r\nowners with more that 1 dog. Pre-registration is encouraged.\r\n\r\nWE ARE CURRENTLY LOOKING FOR SPONSORS!\r\n\r\nTo register or for more information please contact Eboni at 206.322.4856x101 \r\nor email her at eboni@cara-seattle.org\r\n\r\n*****\r\nCARA promotes a broad agenda for liberation and social justice while\r\nprioritizing anti-rape work as the center of our organizing. We use community\r\norganizing, critical dialogue, and collective action as tools to build safe,\r\npeaceful, and sustainable communities. www.cara-seattle.org\r\n\r\nYou may subscribe to the list by sending email to\r\ncara-subscribe@lists.riseup.net'),
(42, '0183feda4e', 'FUCK!!! NOOOO!', 'I upgraded the calendar, and all the data, the format, everything has been lost.\r\n\r\nShit.\r\n\r\n-Benji'),
(43, 'f4073f4253', 'phew', 'Oh good, I fixed it. Phew.'),
(44, '21441a511f', 'vegan potluck &amp; d20 gaming night', 'Is anyone interested in a weekly or biweekly vegan potluck and d20 game night. As far as what game system, that is up to discussion. Any thoughts?'),
(45, '4ded6b9d03', 'Room for 1 to SF Anarchist Bookfair on Friday', 'So three of us are renting a car and driving down to SF for the Anarchist Bookfair. We''ll be leaving early Friday morning (the 17th) and coming back up early Monday morning (the 20th). We have room for one other person and we''d like to find someone who can help cover gas &amp; car rental plus help drive (driving''s not mandatory).\r\n\r\nSend me an e-mail if you''d like to go.\r\n\r\n-Brian\r\nbeneatheuropa@gmail.com'),
(46, '', 'Housing?', 'Does anyone know of any houses with available rooms?'),
(47, '6eac20b898', '', 'Fuck yes, d20 gaming and vegan potlucks totally jock my steaze in a sexual and positive way!'),
(48, 'eb6a1146a7', '3 rooms available in the Green House (U-District)', 'Wow, living space is available in the most amazingly green house in the U District! That''s right folks, the house you have all been waiting to live in finally has openings: two rooms, possibly three! Three guys and three girls are looking for two more roommates to move in April 1. \r\n\r\nIf you''re like me, and I know I am, I like rooms with two windows, because rooms with only one window are only half as windowy! If you want to live in an amazing room with two windows, well, here''s your chance. For only 370 a month (which includes all of the utilities) you can have a nice bright room, with two closets. \r\n\r\nBut wait! That''s not all, included in this deal is a wonderful motley crew of roommates including: writers, musicans, mathematicians, video game design students, freaks, geeks, and nerds. \r\n\r\nAnd you can be assured, that unlike OTHER rooms for rent, we can guarantee that our house will always include a washer/dryer, a kitchen, a roof, TWO bathrooms, a porch (with required couch), parking, cable internet, cable television, running water, free soap, and floors.\r\n\r\nWe are close to UW on 52nd and 11th, seriously close to Scarecrow (so you can be lazy), and even more seriously close to the stop sign at the end of the block, and we can even name two movies that Yahoo Serious was in, serously. At least 4 grocery stores are within walking distance...but of course everything is walking distance if you have the time.\r\n\r\nFREE SOAP, WATER, and AIR!\r\n\r\nUTILITIES INCLUDED IN RENT!\r\n\r\nContact Lindsay @ cherry_bobomb AT yahoo.com or call 206.406.0776'),
(49, 'ad754e9426', 'Looking to form/join band', 'Hi,\r\nI am primarily a guitar player looking to join or form a rather noisy outfit.  Open-minded attitude is a must.  Would also be interested in playing drums for a startup (ie non-serious) band.\r\n\r\n-Jon'),
(50, 'ee05a8a5bb', 'Hello all', 'Hi I''m about to move to seattle from the New Orleans area I''m riding through with Boogdish and am staying in town after the show just saying hello see you all next month.'),
(51, '6ab082e1df', 'My house is looking for a roommate!', 'Room available MAY 1st!\r\n\r\nThis is reposted from my roommate Scott Goodwin, a wonderful man who will soon be departing Seattle.\r\nOur house is dubbed Mansion Kingdom, and we''re looking for someone who is into being active, vegetarian/vegan, likes hanging out and cooking and sharing with roommates, and doesn''t mind a little mess here or there. If you''re interested, write me back with a little about yourself.\r\n\r\nIf you''re looking for a place, or your house has an opening, I would suggest posting on the seattlediy.com message board.\r\n\r\n-Benji\r\nheartxmurmur at yahoo dut com\r\nhttp://www.seattlediy.com\r\nhttp://www.myspace.com/sdiy\r\n\r\n ------------------------\r\n================\r\n\r\nIn case I didn''t email you, you should start telling folks who need a place to live for May about my room.\r\n\r\nI am moving out of my current house May 1st to move to Portland, Oregon for a while. Here''s a description of the deal:\r\n\r\nTHE ROOM:\r\nNice room in a 4-bedroom half of a duplex on 17th Ave E and Republican on Capitol Hill. Hardwood floors, closet, three windows and a small private deck.\r\n\r\nTHE HOUSE:\r\nHouse is a duplex. 4 and 1/2 bedroom in our half of the duplex, two one-bedroom apartments upstairs with nice people living in them. Good sized living room with 2 very comfortable couches, full bathroom, kitchen and one other bedroom on the main floor. Two and a 1/2 bedrooms downstairs with a full bathroom and a TV/band practice area. Laundry room has nice, free washer and dryer that is shared with upstairs neighbors. No large pets, no smoking. A very cute neighborhood cat stops by often though. Mid-sized backyard, small front yard, good sized front porch.\r\n\r\nThe house is in a quiet and alarmingly (or charmingly) ritzy area on 17th and Republican.\r\n\r\nTHE AMMENITIES:\r\nTwo large TVs (for some reaon), each on a different floor. Upstairs has VCR, Playstation 2/DVD, Xbox and downstairs has a PS2 with the TV. Plenty of common movies and video games to watch. Two roommates also work at On 15th Video so there are often plenty of freely rented type movies around, usually 10-15 a week. Cable internet and house filesharing network.\r\n\r\nBand practice area is used by local pop noirists, the Dead Science for practices every so often (usually less than weekly) and is fair game to play music in during daytime hours (though the DS equipment is usually there).\r\n\r\nHouse is close to: Rainbow Co-Op, QFC, Safeway, Cafe Ladro, Victrola Coffee, On 15th Video, Hillside Quickies, Sonic Boom Records, Walgreens, Jamjuree, the Caterbury, Volunteer Park and close by is Madison Market, Trader Joe''s, Gallery 1412, Chop Suey, the Globe, etc. Bus lines 8, 43, 10, and 48 are near by.\r\n\r\nPeople are generally into cooking and sharing food. Benji is a budding soy and almond milk manufacturer, so it is often in abundance.\r\n\r\nTHE ROOMMATES:\r\nFive other folks. Two share a room and one lives in a converted storage room. Vegan/vegetarian friendly house, bike positive, musical folks. Probably the most laid back and into just chillin'' people I have ever lived with. Benji and Mitch are in the band, Der Trasch and Benji runs seattlediy.com and works at the Redmond Old Firehouse and occasionally at Wayward Cafe. Mitch goes to SCCC and works at On 15th Video. Sara goes to and works at UW. Tom plays guitar solos all day and totally shreds. Nick drums in the aforementioned Dead Science and works at On 15th Video.\r\n\r\nTHE DEAL:\r\nAll this is yours for $397 a month 1/6 electricity, phone, and internet bills. You would also have to fill out an application and sign onto the lease until August.\r\n\r\nPlease forward this to anybody you know looking for housing in May.\r\n\r\nEmail heartxmurmur @ yahoo.com if you''re interested.'),
(52, 'b2dae57ec2', 'want to learn to throw pottery?', 'Hi,\r\nI like to throw pottery on the wheel, and I''m looking for a co-op or house that has space in their basement for a kiln and potter''s wheel.  You would have to not mind a little bit of clay getting on the floor.  In exchange for space I would give you free pottery, and pottery lessons, and you could use the wheel and kiln to do your own art projects.  \r\n\r\nI don''t have space in my small apartment for this, but I really miss throwing pottery.  I have a friend who is also a potter who can get a free kiln, then I will find a potter''s wheel on craigslist, and voila!  we''re ready to set up our own communal pottery studio.\r\n\r\nIf you''re interested in doing pottery (it''s so much fun, and very relaxing, and you get to keep the dishes you make), and especially if you have space for a wheel and kiln then give me a call (617-875-9428) or email me (jjoolzz@gmail.com).  \r\n\r\nThanks!\r\n\r\nJulie Wright'),
(53, 'f3759a65c5', 'I want a room!', 'Hello,\r\n\r\nI''m looking for a room to rent in the capitol hill area... in a house or an apartment.  I''m a woman.  I''m a good housemate!  \r\nThanks, Marina\r\nemail: belle1137@yahoo.com'),
(54, 'c3637b3b41', 'Giant Haystacks from Oakland looking for Seattle show', 'Hi,\r\nwe''re a three-piece political punk band in the vein of the minutemen, mission of burma, wire, gang of four, the big boys, etc. We''re looking for a Seattle show on Saturday May 20th. All ages is definitely preferred, houses, basements etc=great. SS Marie Antoinette is already booked although I guess there''s a chance we could be getting added to that bill. If anyone has any other ideas please let us know. A friend suggested Camp Nowhere but I don''t know how to get in touch with them, and I don''t know what other bands to play with. \r\nYou can hear our music at www.gianthaystacks.com and predictably at myspace.com/gianthaystacks \r\nThanks for reading, and my apologies for barging into your forum like this! \r\n- Allan / Giant Haystacks'),
(55, '8ea75b4b9f', 'Tulsa, Oklahoma touring metal needs show', 'Hey WA,\r\nThis is Jor from the Tulsa OK metal band Jor Dan. We are touring thisd summer and looking for a show in Seattle on Friday June 23rd or Saturday June 24th. If anybody books shows, knows someone who books, or has any info. or contacts and would be willing to help us out that would be rad. I can trade shows in OK for anyone in bands that are touring. We have pre vocal demo tracks @ myspace.com/jordanmetal if your interseted. Thanks for your time.\r\nJor'),
(56, 'b8804d1451', 'gtr/drums seek others for epic heavy/quiet band', 'Hey there,\r\n\r\nMy name''s Justin and I''ve been playing music with a kid named Anton for the last couple months.  We''re working something that ranges in style from massively heavy to delicate and atmospheric.  We have two songs pretty much complete but we need a bass player(or keyboardist of the low and ominous nature), possibly a second guitarist and, ideally, a violin/viola player or someone who can play some sort of brass in a haunting way.  \r\n\r\nSome influences are Isis, Shotmaker, Godspeed You Black Emperor, Tragedy, Envy, Majority Rule, Grails, Tarentel, Graves At Sea, Neurosis, Slint, early Cerberus Shoal...\r\n\r\nWe have previous touring and recording experience but you don''t have to.  Being creative and passionate is more important.\r\n\r\nWe practice at my house in West Seattle.\r\n\r\nPlease contact me at: flophaus@hotmail.com or call 206-933-5708\r\n\r\nThanks!'),
(57, '31f8cd7cf6', 'Cheap room available now!', 'The Flophaus in West Seattle has one medium-sized room needing to be filled right now.  We are right under the West Seattle bridge in an industrial-ish area, which is a 5-minute bus ride/15 minute bike ride to downtown. \r\n\r\nRent is about the cheapest in Seattle--$235/mo. \r\n\r\nWe are a 4 person(you''d be the 5th) household of musicians/vegetarians/activists/artists looking for a similar person.  We are not "sxe"(it''s great if you are, though), but those who like to party on a constant basis probably won''t work out here.  We''re 23-31 years old, all employed, laid back and have a sense of humor.\r\n\r\nA security deposit of $265 is needed as well, but we currently pay month-to-month so you wouldn''t need to sign a lease. \r\n\r\nWe have three cats and one rambunctious puppy.\r\n\r\nPlease email Justin at flophaus@hotmail.com or call 206-666-7663 \r\n\r\nThanks.'),
(58, '7f33fdafb9', 'Room(s) open at the BCC!', 'Hi!\r\nMichelle &amp; Noah are moving out of the Ballistic Chicken Coop in order to take a road trip.  Their room will be available a flexible mid-June.    There are also June/July/Aug sublet opportunities.\r\n\r\nThe People:\r\nStefanie: Plays music (french horn for INB &amp; Yellow Hat Band).  Does Food Not Bombs.  Home Alive Instructor.  \r\nKevin: Gardens (mm, veggies).  Plays Music (Brass, guitar, bass).  Will be a Master Composter soon.\r\nAmanada: Takes care of kids for money-earning purposes.  Recovering from Fresno.  Makes stuff.  \r\nKalin: Cycles.  Will bike from here to Southern CA starting in a few weeks.  Aikido practicing.\r\nCorrina: Finishing master''s degree supporting estuary restoration.  Plays music.  Gardens (flowers, horray.)  Food Not Bombs.\r\nFelix, Boo, Heidigger, Jena, Ginger, and Chickychickychickchickchick :  The cats and chickens that live with us (but are not allowed upstairs or inside respectively.)\r\n\r\nIt''s a co-op even though we have to pay rent to a landlard.\r\n-We share food expenses (all vegetarian mostly vegan.)\r\n-We live together in a house!  There are house meetings sometimes.  \r\n-We share the work\r\n-We do activist networky things like are members of the pantry, etc.\r\n\r\nThe House:\r\n-It''s big and somewhat beautiful (especially the garden and the hardwood floors.)  We have a piano, a bike shed, tools, decent &amp; well equipped kitchen, and large common space.\r\n-Is located in wallingford\r\n\r\nAnd, what you''ve been scrolling down for:\r\nThe Room:\r\nThe room is very large and has two huge sleeping closets, therefor is suited best for a couple or roomates.  In this situation, each individual pays only $265 a month (plus cheap utils and food.)  There is one big pair of windows in the main room that look out over the garden and towards the mountains to the east.  The sleeping closets have windows too and are big enough to squeeze a queen sized bed plus a dresser or other furniture.  They are sweet.  First and last and $165 deposit.\r\n\r\nContact: bcc@silverninja.net.  634-4243 .  We don''t have a decision deadline set yet, but probably early may.  Give us a call for details on the sublet options too.'),
(59, '3202f4b332', 'NEED DRUMMER for summer tour with Antlers', 'We need a drummer to go on tour with us in august across the country with our friends, Antlers. We''re a new 3 piece hardcore punk band called Cherokee. Our influences are High On Fire and Botch. We''re hoping to find a tour drummer and a new drummer at the same time. If we like you, and are good enough, you could be apart of the band. The drummer right now is a friend of ours name Mat who plays in Antlers, but he is only temporary because he has another band. We meed a solid drummer who is a good guy. All drummers that apply need: \r\n\r\n* to be around the age of 18-25 \r\n* a good drummer \r\n* to be a non-drinking and does not smoke weed or any other drugs. (we stress this very much) \r\n* have his own drum kit. \r\n* have a job or enough money to pay for a month of touring. \r\n\r\nWe will be recording a demo soon with Mat, so who ever wants to audition, can get a copy to learn one of our songs. we will then try you out by playing the one you learned at out practice space in Issaqua. \r\n\r\nyou can e-mail me at oarecords@yahoo.com\r\n\r\nkeep in touch, \r\nJosh Bolof'),
(60, '3ce26f7af8', 'summer sublet needed...', 'i need to find a summer sublet.  cap hill/central dist.  flexible times...roughly june--august.\r\n\r\ndog friendly would be a plus but not mandatory.  veg house preferred.  bike friendly house a must.  \r\n\r\nandrea@phillybma.org'),
(61, '9820c3dd82', 'All ages house party @ the Greenhouse- Saturday, April 22nd', 'We''re having another house party Saturday April 22nd featuring Grey, Kilauea, and Slave Traitor.  Much fun will be had.  All ages, bar w/ID.  Please come on out and enjoy a night of great music.  natron :shock: [/b]'),
(62, 'ffab5d961d', 'we have a myspace now', 'http://myspace.com/cherokeedeath'),
(63, '3a4e895dc3', 'Boston band on tour in June. WE &lt;3 SEATTLE!!!', 'Well, most of us have never been but I here from my close friend Forrest that it is the greatest city ever. I am in Ask Mice ( http://www.myspace.com/askmice ) a punky, thrashy, dancy, whatever band. We are trying to do a full US tour in June and have not yet found a Seattle date. We will be touring with Mendicant Friends from NYC. They are a great folk, epic whatever (I hate describing bands) band. We will be in Seattle on the 14th. Does anyone have a hint they could throw me? We often enjoy the likes of basements and small DIY clubs but are open to other places for sure. We are willing to play for all types of audiences. We have a van that we can sleep in so we wont be forced to burden you for beds... you are also welcome to sleep in the van if you yourself are without a nightly resting place. So check out the music and crappy video we have up if you might be interested.\r\n\r\nThanks much.\r\ntom'),
(64, 'f8ecea170e', 'DIY Academy 2006 Needs Instructors!!!', 'We''re currently looking for instructors for this years DIY Academy. Applications are due really soon [u:f8ecea170e]MAY 8th[/u:f8ecea170e], 10 days away! You can get an application at ZAPP in the basement of the Richard Hugo House\r\n1634 11th Ave.\r\nSeattle, WA 98122\r\n206-322-7030 or send me a message and I''ll send you a PDF. Some examples of great workshops would be screenprinting, art comic making, stencilling, low-cost bike repair, make your own bio-diesel, anything having to do with zines and d.i.y. publishing, etc.\r\n\r\nSpread the word to all your friends, everyone has some interesting skills that they can teach and share with others.\r\n\r\nWe''re also looking for bands and possibly a DJ that are available for DIY Academy opening night party June 21st.\r\n\r\nDIY ACADEMY is a series of low cost workshops that can enrich your life and local Seattle culture through the do-it-yourself movement. This series will run from June - August 2006. DIY is sustainable, affirming and really fun! Every person should have a chance to use the work of their hands and minds to empower themselves. Why fill your life with only what the corporate machine can sell you?'),
(65, '71c7675047', 'DESIGNERS, ETC. NEEDED FOR LOCAL DIY FASHION SHOW', 'Do you design your own clothing but have no outlet for your creativity? We are looking for you! Local DIY designers are needed for a fashion show in Seattle that will be held around August. We are looking for any designer, any style…anything can be made and we love creative people! \r\n\r\nWe will also be needing help for other parts of the show…including: \r\n\r\nModels (of all shapes and sizes!) \r\nHair &amp; Makeup \r\nDJ’s or Musicians \r\nSet Crew \r\nPhotographers \r\n\r\nETC..ETC….. \r\n\r\nALSO! This is a great opportunity! We have a goal of creating publicity with this event so get involved and let your work be seen. \r\n\r\n\r\nEmail: seattlediyfashion@hotmail.com'),
(66, 'eea8d7ee46', 'SEATTLEDIY.COM MEETING!!! May 16th!', 'SEATTLEDIY.COM MEETING!!\r\nSeattleDIY.com will have an open meeting to discuss how we want to expand this project.\r\n\r\nThe meeting will be at the Wayward Cafe (near 55th + Roosevelt in the U-District) at 4pm on Tuesday May 16th.\r\nCome with ideas, and a couple bucks if you''d like to order some food.'),
(67, '8fbdea2fe1', 'Need a cheap room for May?', 'The Flophaus in West Seattle has a room open this month for only $200.  We have to move out by June 10th due to the landlord selling the house.  \r\n\r\nWe are only a five minute bus ride to downtown and are located in the industrial area near the West Seattle bridge.  We are 4 veggies/musicians/artists.  \r\n\r\nGive us a call at 206-933-5708 or email flophaus@hotmail.com\r\n\r\np.s. We are not an actual flophaus!'),
(68, '08fc2a7831', 'Date + time changed!', 'Date and time changed to 4pm on Tuesday May 16th!\r\n\r\n-Benji'),
(69, '976bbca072', 'Re: stealin wheels IS NOT cool', '[quote:976bbca072="amanda"]keep your eyes out for my wheel! its a 650 with a bright yellow tire, although i am sure it was stolen for the hub (phil wood). it happened tonight (Thursday, Jan 19) outside the College Inn before 10pm! my bike is not only the love of my life, but also the way i transport myself around town! bicyclesinskirts@gmail.comrock on.[/quote:976bbca072]'),
