(1, '7d17623a2e', 'Hi Camp Nowhere.  This is Nathan from the Greenhouse.  We are an all-ages monthly house show place in the CD.  I have an event that I''d like you guys to be a part of.  It is of the festival sort and would happen at the end of August.  My email is supercontra@gmail.com.  If possible, please contact me there.  I''d very much like to give you all the details, and I think it''d be far easier via email.  The Greenhouse is also on myspace as the Greenhouse.  Look us up.  Hope to talk soon.  Thanks for your time and take care.  natron.'),
